        [Fact]
        public void ToString_SFormat_FormatsNumberWithGivenDigitsAfterRadixForCurrentCulture()
        {
            var oldCulture = CultureInfo.CurrentUICulture;
            try
            {
                CultureInfo.CurrentUICulture = CultureInfo.InvariantCulture;
                Assert.Equal("0.1 /m", new ElectricLinearResistivity(0.123456, ElectricLinearResistivityUnit.OhmPerMeter).ToString("s1"));
                Assert.Equal("0.12 /m", new ElectricLinearResistivity(0.123456, ElectricLinearResistivityUnit.OhmPerMeter).ToString("s2"));
                Assert.Equal("0.123 /m", new ElectricLinearResistivity(0.123456, ElectricLinearResistivityUnit.OhmPerMeter).ToString("s3"));
                Assert.Equal("0.1235 /m", new ElectricLinearResistivity(0.123456, ElectricLinearResistivityUnit.OhmPerMeter).ToString("s4"));
            }
            finally
            {
                CultureInfo.CurrentUICulture = oldCulture;
            }
        }

